import './App.css';
import Register from './Components/Register';
import Login from './Components/Login';
import Product from './Components/Product';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './Components/Home'
import About from './Components/About';
import Favorite from './Components/Favorite';
import { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import MyLogin from './Components/MyLogin';
// import RegisterTrader from './Components/RegisterTrader';
// import LoginTrader from './Components/LoginTrader'





function App() {

  const [userId, setUserId] = useState(null);

  useEffect(() => {
    const storedUserId = localStorage.getItem("userId");
    if (storedUserId) {
      setUserId(storedUserId);
    }
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path='/About' element={<About/>}/>
        <Route path='/Login' element={<Login/>}/>
        {/* <Route path='/LoginTrader' element={<LoginTrader/>}/> */}
        <Route path="/Register" element= {<MyUserRegi/>}/>
        {/* <Route path='/registerTrader' element={<RegisterTrader/>}/> */}
        <Route path="/Product" element= {<Product/>}/>
        <Route path="Favorite" element={<Favorite/>}/>

      </Routes>
    </Router>
  );
}

export default App;
